import { useState } from "react";


const LogIn = (props) => {
    const [name, setName] = useState('')
    return (
        <>
            <div className="LogIn">
                <h1 className="LogIn-h1">{props.title}</h1>
                <p>{name}</p>
                <input type="text" placeholder="Name" onInput={(event) => setName(event.target.value)}/>
            </div>
        </>
    )
}

export default LogIn;
